function getUsersFromSections(sections) {
  let users = [];
  sections.map(s => {
    let medias;
    if (s.layout_type === "media_grid") {
      medias = s['layout_content']['medias']
    } else {
      medias = s['layout_content']['fill_items']
    }
    medias.map(m1 => {
      let m = m1.media;
      let user = m.user;
      users.push({
        ig_id: user.pk,
        username: user['username'],
        shortcode: m['code'],
        taken_at: m['taken_at']
      })
    })
  })
  return users;
}

